import React from "react";
import Qualitie from "./qualitie";
import BookMark from "./bookmark";

const User = () => {
    <>
        <td scope="col">props.users.name</td>
        <td scope="col">{Qualitie()}</td>
        <td scope="col">Профессия</td>
        <td scope="col">Встретился, раз</td>
        <td scope="col">Оценка</td>
        <td scope="col">{BookMark()}</td>
        <td/>
    </>

}

export default User;
